						<span>. . .</span>
					</div>
				</div>
				<div className="activity-item">
					{/* <div className="lorem"></div> */}
				</div>
				<div className="activity-item">
					{/* <div className="ipsum"></div> */}
				</div>
			</div>
		</>
	);
};

export default ActivityTab;
